import React from "react";
import styled from "styled-components";
import { AiOutlineUser } from "react-icons/ai";
const DashboardScreen = () => {
  return (
    <Wrapper>
      <div className="dashboxes">
        <div className="dasbox">
          <div className="icon">
            <AiOutlineUser />
          </div>

          <p>Total Users</p>
          <h4>1,000</h4>
        </div>
        <div className="dasbox">2</div>
        <div className="dasbox">3</div>
        <div className="dasbox">4</div>
        <div className="dasbox">5</div>
        <div className="dasbox">6</div>
      </div>
    </Wrapper>
  );
};

export default DashboardScreen;

const Wrapper = styled.div`
  width: 90%;
  margin: auto;
  background: grey;
  .dashboxes {
    width: 60%;
    display: flex;
    justify-content: space-between;
    flex-wrap: wrap;
  }
  .dasbox {
    width: 250px;
    height: 200px;
    background: white;
    box-shadow: rgba(0, 0, 0, 0.35) 0px 5px 15px;
    border-radius: 5px;
    margin: 10px;
    color: black;
    padding: 10px;
  }
  .dasbox:hover {
    background: black;
    color: white;
  }

  .icon {
    width: 30px;
    height: 30px;
    border-radius: 5px;
    background: blue;
    padding: 10px;
  }
`;
